INSERT INTO `t_cms_content_news` VALUES (51,'            \r\n\t\t\t<p>同样的高考，不一样的备战。记者探访发现，在不少高中的最后一堂课上，为让学生放松心情，有的会让学生通过唱歌的方式给自己加油鼓劲，有的会送给学生们橙子，寓意将来高考一定会成功，还有的会赠送学生照片等礼物，以给他们的高中生活留下一段美好的记忆。但是也有学校奉行“高考当平时，平时当高考”的理念，直到高考前一天还正常上自习，高考当天上午仍正常出早操、上晨读。</p><p><img src=\"http://n.sinaimg.cn/news/crawl/20170606/aDdC-fyfuzmy2090515.jpg\"></p><p>5日，济宁嘉祥一中，一群高三女生走过写满励志标语的走廊。齐鲁晚报·齐鲁壹点&nbsp;记者马辉摄&nbsp;</p><p>德州一中：</p><p>考前合唱助威，送学生特殊纪念照</p><p>“叮铃铃……”5日上午8点30分，随着清脆的上课铃声响起，德州一中高三毕业生迎来高中生涯的“最后一课”。夏日的风从窗口吹来，教室里有些微热，墙上贴满励志标语，黑板上写着祝福心愿，天花板上风扇徐徐转动，课桌上依然摆着课本，一切都散发着青春的气息。记者走到高三14班的教室，班主任候志强正嘱咐学生考试时需要注意的事项，以及如何调整心态、走进考场后如何缓解紧张情绪。</p><p>“我不要求你们考多少分，我只希望你们都能做最好的自己，相信14班的每一位同学都是最棒的。”班主任侯志强说完，全班响起了雷鸣般的掌声，回想一起走过的1000多个日子，这样的“最后一课”显得似乎有些沉重。紧接着，由班主任侯志强领唱，全班共同唱响汪峰的歌曲《英雄》，一句句歌词扣人心弦，令侯志强数度哽咽，掩面而泣，也让全班不少同学流下了激动的泪水。</p><p><img src=\"http://n.sinaimg.cn/news/crawl/20170606/amOG-fyfuzny3420052.png\"></p><p>德州一中毕业班的老师将同学们3年来的影像资料整理打印后写上寄语作为给学生的毕业礼。齐鲁晚报·齐鲁壹点记者马志勇摄&nbsp;</p><p><br></p>','1',' '),(52,'                        \r\n\t\t\t<p>“我老伴不太笑，总是板着个脸。但3个月前，他就像变了一个人，面部五官不停抽动，看起来就像在做鬼脸，蛮会逗孙子开心，起先我们以为他年纪大转了性，但后来觉得不对，是不是五官出了什么毛病，于是硬拉着他来浙江医院检查。”李大伯的老伴赵阿姨说。</p><p>经详细问诊得知，65岁的李大伯在5年前曾经突然感到头晕、眼睛发花，这3个月期间数次出现这种情况。浙江医院心血管内科主任唐礼江主任医师认为，李大伯患心脏病的可能性很大。一系列检查做下来，证实了他的推断，李大伯被确诊患有持续性房颤。由于心率长时间没有得到控制，李大伯的心脏已经扩大到常人的一倍。</p><p>唐礼江主任称，通常来说，正常的心跳是60至100次/分钟，当心跳出现过快、过慢或不规则时，就是房颤。房颤会加重冠心病、心绞痛，很容易引起心衰，房颤发作时，由于心房不能有效收缩，心房内的血液不能完全泵到心室里面，这些滞留的血液就容易形成血栓。如果血栓脱落，随着血液流动到大脑，就会引起卒中，房颤诱发中风的风险是常人的5倍。</p><p>唐礼江主任特别提醒：如果家里有上了年纪的老年人，经常抱怨爬楼梯觉得胸闷心跳快，而像这种情况休息一会儿就又好了，普通人不太会往心里去，其实就要留心，可能就是房颤在作怪。</p><p><br></p>\r\n\t\t\t','1','8'),(53,'                                    \r\n\t\t\t<p>扬子晚报网6月5日讯（通讯员&nbsp;魏静&nbsp;记者&nbsp;高峰）乡镇的房屋即将拆迁，而自己作为家中顶梁柱无力购买新房，男子唐某某因家庭负担重借酒消愁，但也难以消解心中的抑郁之情。喝完酒，正巧看到村子路两旁新栽种的树苗，于是拿起家中的菜刀跑到路两旁砍树，以发泄心中的不满，一夜之间砍断了475棵绿化树苗。近日，泗洪县人民法院以寻衅滋事罪判处唐某某拘役四个月，缓刑八个月。</p><p>据唐某某当庭供认，今年3月15日晚上，自己在亲戚家喝了酒，大概10点回家。自己路过村子水泥路的时候，看到水泥路两边栽了很多新树苗，当时心里想，我们村子都快拆迁了，整个村庄很快就不在了，自家的家前屋后的树木，连大带小的已经全部卖掉了，怎么还会有人在水泥路两边重新栽种新的树苗呢？加之，拆迁赔的钱根本不够重新买一套新房的，于是，他越想越气，回家拿起家中的菜刀，就去砍路边的树苗，只要是能看到的树苗都被自己砍了。</p><p>经查明，唐某某归案后如实供述了自己的犯罪事实，在案件侦查阶段，唐某某赔偿了某居委会经济损失。“现在，我很后悔自己做的这件事！当时喝了酒，心烦意乱的，为了发泄心中不满情绪，做了这种蠢事！”唐某某说。</p><p><br></p>\r\n\t\t\t\r\n\t\t\t','5','0');

